import { createSelector } from "../../utils/selectors.js";
const selectVoronoi = state => state.voronoi;
export const selectorChartsVoronoiIsVoronoiEnabled = createSelector(selectVoronoi, voronoi => voronoi?.isVoronoiEnabled);
